INSERT INTO `screenings` VALUES (1,2,4,2,'2024-06-05',2,36,12080,60,NULL,'Febre , dor de cabça.','2024-06-05 07:26:56','2024-06-05 07:26:56'),(2,1,1,5,'2024-06-07',12,30,12345700,NULL,NULL,NULL,'2024-06-07 14:16:38','2024-06-07 14:16:38'),(3,2,9,8,'2024-06-10',10830,37,NULL,60,NULL,NULL,'2024-06-10 08:34:54','2024-06-10 08:34:54'),(4,2,5,6,'2024-06-10',7.9,35,NULL,90,NULL,'Criança com  evolução satisfatória, com ganho de 700 gr. de peso, está com leve congestão nasal e tosse esporádica. Tolera bem a alimentação. Mantém uso de vitaminas. \nDesenvolvimento: Fica em pé com apoio nos móveis. Dentição: 6 dentes \nExame físico: bom estado geral e deficiente estado nutricional , hidratado mucosas normocoradas e humidas , linfonodos normais.\nACV. : batimentos cardiacos ritmicos e sem sopros\nA.R: Murmúrio vesicular presente sem ruídos adventícios \nAbdomen: Livre   \n\nDiagnóstico: Malnutrição em tratamento\nConduta: Multivitaminas e dieta','2024-06-10 10:15:32','2024-06-10 10:15:32'),(5,2,5,6,'2024-06-10',7.5,36,6,10,NULL,'Estado geral, razoável','2024-06-10 11:01:37','2024-06-10 11:01:37'),(6,2,9,9,'2024-06-11',13,36,NULL,60,NULL,'Queixa principal: Dores  abdominais e  obestipação','2024-06-11 10:13:01','2024-06-11 10:13:01'),(7,2,9,10,'2024-06-12',52.5,34.5,NULL,88,NULL,NULL,'2024-06-12 05:08:11','2024-06-12 05:08:11'),(8,2,5,10,'2024-06-12',52.5,34.5,NULL,88,NULL,'Paciente portadora de drepanocitose, há 2Diagnóstico: Drepa4 horas paciente iniciou com dor abdominal, irradiando para a região lombar, anorexia e mal estar geral. Nega febre \nExame físico: Alerta, hidratada, mucosas hipocoradas 2+/4+, subictérica. Orofaringe normal, linfonodos normais.\n\nACV: batimentos cardiaco rítimicos com sopro sistólico grau II/VI.\nACR: murmúrio vesicular presente sem ruídos adventícios.\nAbdome - plano normotenso, baço medindo 7 cm abaixo do reborde costal esquerdo, com superfície lisa.\nExtremidades sem edemas . \n\nConduta: solicito hemograma, pesquisa de plasmódio, urina sumária, reacção de Widal\nPrescrevo: Glucofisiológico 1000 ml + complexo B 2 amp - correr EV 48 gotas/mint\n                    Ceftriaxona 1 gr EV\n                   Diclofenaco de sódio 75 mg - 3ml IM\nResultado de aná lises \nPesquisa de plasmódio negativa;  Reacção de Widal O-1/60;  H- 1/80.\nHemograma: Hb  7 gr/dl; Hto 20%  HCM 20  VCM 62\nLeucocitos 8.700  Linf 13%  Granul 80,6% \nDiagnóstico: Drepanocitose - Anemia moderada \n                       Crise vaso oclusiva/ Esplenica \n                        Salmonelose \nTerapéutica:   Amoxacilina + Acido clavulanico; Ibuprofeno; ácido fólico, Multivitaminas','2024-06-12 05:41:47','2024-06-12 06:49:59'),(9,1,1,16,'2024-06-12',57,37,110,50,NULL,'normal','2024-06-12 07:27:33','2024-06-12 07:27:33'),(10,2,7,9,'2024-06-12',45,37,NULL,50,NULL,'FEBRE, DOR DE CABEÇA','2024-06-12 07:29:01','2024-06-12 07:29:01'),(11,2,6,9,'2024-06-12',2,36.5,NULL,61,NULL,'Cefaleia e Febre','2024-06-12 08:16:12','2024-06-12 08:16:12'),(12,1,1,16,'2024-06-12',57,545,59,980,NULL,'mohnh','2024-06-12 08:33:58','2024-06-12 08:33:58'),(13,2,7,9,'2024-06-12',50,37,NULL,45,NULL,'frebre e dores de cabeça','2024-06-12 08:34:17','2024-06-12 08:34:17'),(14,2,9,17,'2024-06-13',74,36,120,65,NULL,'Queixa principal:  Diarreia  e Dor de cabeça','2024-06-13 09:31:26','2024-06-13 09:31:26'),(15,2,9,17,'2024-06-13',74,36,120,65,NULL,'Queixa principal: Diarreia e dor de cabeça','2024-06-13 09:36:13','2024-06-13 09:36:13'),(16,2,7,17,'2024-06-13',74,36,120,65,NULL,'Diarreia, Dor de barriga e Fraqueza, calafrio, dor de cabeça e boca amarga','2024-06-13 09:50:12','2024-06-13 09:50:12'),(17,2,4,18,'2024-06-14',10,5,10,10,NULL,'Paciente consciente com estado geral razoável. Com queixas de cefaleia e Febre.','2024-06-14 10:13:22','2024-06-14 10:54:50'),(18,2,9,20,'2024-06-14',78,36,NULL,109,NULL,'Pacience veio a consulta de pre-natal com queixas de falta de apetite, e urina com muita frequência, nega dor de baixo ventre, sangramento, afebril Estrado Geral razoável. exame fisico: sem alterações. Resultado dos exames urina sumaria positiva e pp positivo. conduta: folifer, velvet materno, clavamox, vitc, artemehter oral, vicombil xarope, fansidar, albendazol','2024-06-14 11:43:11','2024-06-14 12:13:34'),(19,2,6,22,'2024-06-14',62,36,NULL,88,NULL,'Pcaiente veio a consulta de controlo com resultado de ecografia que revelou escasso liquido em fundo uterino e microcalcificação endometrial. Hipótese Diagnóstica: Doença  Inflamatória Pélvica. Conduta: DOXICICLINA, METRONIDAZOL E RELMUS.','2024-06-14 12:46:48','2024-06-14 13:05:18'),(20,2,6,23,'2024-06-14',65,36,NULL,90,NULL,NULL,'2024-06-14 12:47:52','2024-06-14 12:47:52'),(21,2,6,24,'2024-06-14',77,36,NULL,83,NULL,NULL,'2024-06-14 12:54:11','2024-06-14 12:54:11'),(22,2,10,22,'2024-06-14',62,36,NULL,88,NULL,'Pcaiente veio a consulta de controlo com resultado de ecografia que revelou escasso liquido em fundo uterino e microcalcificação endometrial. Hipótese Diagnóstica: Doença  Inflamatória Pélvica. Conduta: DOXICICLINA, METRONIDAZOL E RELMUS.','2024-06-14 13:04:29','2024-06-14 13:04:29'),(23,2,10,21,'2024-06-14',62,36,NULL,70,NULL,NULL,'2024-06-14 13:18:52','2024-06-14 13:18:52'),(24,2,10,21,'2024-06-14',62,36,NULL,70,NULL,NULL,'2024-06-14 13:19:54','2024-06-14 13:19:54'),(25,2,10,21,'2024-06-14',62,36,NULL,70,NULL,'PACIENTE VEIO A CONSULTA DE PRE NATAL SEM QUEIXAS DE REALCE, AFEBRIL ESTADO GERAL RAZOÁVEL.EXAME FISICO: SEM ALTERAÇÕES. HD: GRAVIDEZ DE 26 SEMANAS E 2 DIAS + MIOMA UTERINO. CONDUTA: GESTACARE, FANSIDAR, ALBENDAZOL.','2024-06-14 13:27:57','2024-06-14 13:27:57'),(26,2,10,24,'2024-06-14',77,36,NULL,83,NULL,NULL,'2024-06-14 13:40:08','2024-06-14 13:40:08'),(27,2,10,24,'2024-06-14',77,36,NULL,83,NULL,'PACIENTE DE 35 ANOS DE IDADE, AO GESTA 3 PARTOS 2 ABORTOS 0, DUM 04/02/2024 COM AMENORREIA DE 18 SEMANAS E 5 DIAS PELO FUM PELA ECOGRAFIA 17 SEMANAS E 1 DIA, DPP 10/11/2024, VEIO A CONSULTA DE PRE NATAL SEM QUEIXAS DE REALCE , A FEBRIL ESTADO GERAL RAZOÁVEL. HD: GRAVIDEZ DE 17 SEMANAS E 1 DIA. CONDUTA: FOLIFER, VELVET MATERNO, ULTRAGESTAN. PEÇO ECOGRAFIA MORFOLOGICA SEGUNDO TRIMESTRE.','2024-06-14 13:51:54','2024-06-14 13:51:54'),(28,2,9,28,'2024-06-17',98,36,NULL,63,NULL,'Queixa Principal: dor de cabeça e mau estar.\nPaciente masculino de 46 anos de idade, vem à consulta com queixas de cefaleia e mau estar geral há mais ou menos três dias, cujo o mesmo fez o uso do analgésico Gen-Payne (composto de ibuprofeno, paracetamol e codeína) para alívio dos sintomas.\nEstado geral e nutricional razoável, mucosas oral e conjuntival húmidas e bem coradas, TCS não infiltrado;\nA.R: M.V presente e audível em ambos campos pulmonares, sem ruídos adventícios;\nA.C.V: Tons cardíacos audíveis e normofonéticos sem extra-tons;\nA.B.D: Globoso à custa do paniculo adiposo, indolor à palpação superficial e com ligeiro desconforto à palpação profunda no hipogástro e na FIE.\nS.N.C: Calmo, colaborante, orientado no tempo espaço e pesoa, sem sinais de irritação meníngea.\n\nPara melhor estudo e diagnóstico solicito:\n- Reação Widal,\n- Pesquisa de Plasmódio.\nDiagnóstico: Malária Simples.\nTratamento: Coartem (80/480mg) e Paracetamol (500mg).','2024-06-17 05:59:00','2024-06-17 09:53:25'),(29,2,9,29,'2024-06-17',5.185,36,NULL,60,NULL,'Altura: 60 cm\nCC: 41 cm\nCA: 37 cm','2024-06-17 07:18:52','2024-06-17 07:18:52'),(30,2,9,30,'2024-06-17',80,35,NULL,64,NULL,'Paciente masculino de 43 anos de idade que vem à consulta queixando-se de epigastralgia há mais ou menos três dias,quadro esse que começou depois de fazer uma refeição fora de cas. \nO mesmo fez o uso dos fármacos Gaviscon e Omeprazol 20mg e teve alívio dos sintomas, referet ambém distensão abdominal há dois dias. \n\nHoje se queixa de cefalei frontal há menos de 24h.\n\nExame físico: estado geral e nutricional razoável, mucosas húmidas e bem coradas, TCS não infiltrado;\nA.R: M.V mantido e bem audível em ambos campos pulmonares, sem ruídos adventícios;\nA.C.V: Tons cardíacos normofonéticos;\nA.B.D: Globoso à custa do panículo adiposo, indolor à palpação superficial e profunda.\nS.N.C: Calmo, colaborante e orintedo no tempo espaço e pessoa, sem sinais de irritação meníngea.\nSolicito os seguintes para melhor estudo e tratamento:\n- Pesquisa de Plasmódio;\n- R. Widal;\n- H. Pylori.\n\nDiagnóstico: Febre Tifóide.\n\nTratamento: Azitromicina (500mg), Paracetamol (500mg), Omeprazol (20mg).','2024-06-17 07:29:42','2024-06-17 10:43:38'),(31,2,9,31,'2024-06-17',93,36,NULL,84,NULL,'Queixa Principal: dor no peito, dificuldade para respirar.\n\nPaciente feminina de 43 anos de idade que vem à consulta queixando-se de toracolgia há mais ou menos uma semana sem tosse, e dor na coluna torácica há mais ou menos quatro dias.\nqueixando-se também de ardor nos olhos e nariz após inalar muita fumaça no local de trabalho.\n\nExame físico: estado geral e nutricional razoável, mucosas húmidas e bem coradas, TCS não infiltrado;\nA.R: M.V presente e audível em ambos campos pulmonares, sem ruídos adventícios;\nACV: Tons cardíacos audíveis e normofonéticos;\nSNC: Calma colaborante e orientada, no tempo, espaço e pessoa.\nConduta: Losartan 50mg.\nPeço: P.P, R.Widal, Hemograma.\n\nDiagnóstico: Malária com anemia moderada, toracolgia.\nTratamento: Folifer, Coartem, Paracetamol.','2024-06-17 07:46:56','2024-06-17 11:53:27'),(32,2,9,31,'2024-06-17',93,36,NULL,80,NULL,NULL,'2024-06-17 08:25:30','2024-06-17 09:20:44'),(33,2,5,29,'2024-06-17',5.25,36,NULL,120,NULL,'Idade 2 meses; CC- 41 cm; CA-37 cm\nLactante com  histórico de ausência de aumento de peso no 1º mês de vida. Há 30 dias com aleitamento misto. Hoje retorna com queixa de refluxo,  bom estado geral, em um mês teve ganho de 1.255 gr. Funções de eliminação presentes. \nExame físico: Alerta, activa e reactiva, hidratada, corada, acianótica, fontanelas normotensas, reflexos presentes.  Eupnéica e eucardica. \nACV : Batimentos cardiacos rítmicos e sem sopros.\nAR.: Murmúrio vesicular presente sem ruídos adventícios.\nAbdome: Globoso e normotenso,  sem visceromegalias palpáveis. RHA presentes. \nExtremidades: sem edemas \nDiagnóstico: Refluxo Gastroesofágico fisiológico  em criança saudável \n\nConduta:\nDieta: leite materno livre demanda, complementar com Nutribem 60 ml  de 3/3 horas \nMedidas posturais \nQuantivit 10 gotas / dia \nEstimulo do desenvolvimento \nVacina contra meningite aos 3 meses','2024-06-17 08:31:07','2024-06-17 08:31:07'),(34,2,6,32,'2024-06-17',93,36,NULL,63,NULL,'Queixa Principal: Dor no pescoço e no peito,  tosse com catarro.\nPaciente feminina de 49 anos de idade, que vem á consulta com queixas de toracolgia que se acompanhava com tosse produtiva há mais ou menos uma semana, e há mais ou menos três dias começou com um quadro de de dor cervical e cefalei.\nEstado geral e nutricional preocupante, mucosas húmidas e bem coradas, TCS não infiltrado.\nA.R: M.V presente em ambos campos pulmonares, porém diminuido;\nA.C.V: Tons cardíacos audíveis e normofonéticos;\nABD: Globoso à custa do panículo adiposo, e indolor à palpação.\nPeço: \n- Hemograma;\n- R. Widal;\n- Pesquisa de Plasmódio.\n\nDiagnóstico: Febre tifóide, S. Gripal.\n\nTratamento: Losartan (50mg) dois comprimidos','2024-06-17 09:04:54','2024-06-17 12:34:02'),(35,2,9,33,'2024-06-17',98,36,NULL,67,NULL,'Queixa Principal: Dor de barriga.\n\nPaciente masculino de 34 anos de idade que vem à consulta queixando-se de dor abdominal há mais ou menos três dias, onde o mesmo fez o uso de metronidazol sem alívio dos sintomas.\nEstado geral e nutricional razoável, mucosas húmidas e bem coradas, TCS não infiltrado. \nA.R: M.V presente e bem audível em ambos campos pulmonares, sem ruídos adventícios;\nA.C.V: tons cardíacos audíveis e normofonéticos;\nA.B.D: globoso à custa do panículo adiposo, segue a dinâmica resiratória, e indolor à palpação.\nS.N.C: calmo, colaborate, orientado no tempo espaço e pessoa, sem sinais de focalização neurológica. \n\nPara melhor estudo e tratamento solicito: \nP.P, R. Widal.\nDiagnóstico: Febre Tifóide.\nTratamento: Ciprofloxacina (500mg) e Paracetamol (500mg).','2024-06-17 09:55:41','2024-06-17 12:02:05'),(36,2,9,34,'2024-06-17',87,36,110.67,78,NULL,NULL,'2024-06-17 12:46:03','2024-06-17 12:46:03'),(37,2,9,35,'2024-06-17',47,36,90.68,102,NULL,NULL,'2024-06-17 13:07:32','2024-06-17 13:07:32'),(38,2,9,34,'2024-06-17',87,36,NULL,78,NULL,'Paciente veio a consulta de pré natal sem queixas de realce, afebril estado geral razoável. EXame fisíco: sem alterações. HD: Gravidez de 36 semanas e 5 dias + Infecção do trato urinario','2024-06-17 13:42:20','2024-06-17 13:42:20'),(39,2,10,35,'2024-06-17',47,36,NULL,102,NULL,'Pciente veio a consulta de pre natal com quexas de corrimento vaginal, tonturas em ocasiões, afebril estado geral razoável. Especulo: especulo colo de nulipara com presença de leucorreia. HD: Gravidez de 13 semanas + vulvovaginite. Conduta: Folifer, velvet materno, clotrimazol óvulos','2024-06-17 14:13:37','2024-06-17 14:13:37'),(40,2,8,36,'2024-06-18',58,36,120.68,58,NULL,NULL,'2024-06-18 06:27:49','2024-06-18 06:27:49'),(41,1,1,37,'2024-06-18',14,14,14,14,NULL,NULL,'2024-06-18 06:41:47','2024-06-18 07:09:40'),(42,2,12,36,'2024-06-18',58,36,120.68,58,NULL,'QUEIXA PRINCIPAL:\nFEBRE, DOR DE CABEÇA,  DOR NAS ARTICULAÇOES\n\n\nHDA: TRATA-SE DE UM PACIENTE SEM APP QUE VEM A CONSULTA COM QUADRO CLINICO CARAVCTERIZADO POR CEFALEIA, CONCOMITANTEMENTE FEBRE, ARTALGIA E MAL ESTAR GERAL. TEVE COMO FACTOR DE ALIVIO A TOMA DE PARACETAMOL, SEM MELHORIA DO SEU QUADRO CLINICO ACORRE A CONSULTA\n\n\nEOG E FISICO: CONSCIENTE, EUPNEICO, HEMODINAMICAMENTE ESTAVEL\nABD- PLANO SEM ALTERAÇAO\nMI- SEM EDEMAS\n\n\n\nHD: SALMONELOSE','2024-06-18 06:51:24','2024-06-18 09:14:27'),(43,1,1,38,'2024-06-19',56,35,10,73,NULL,'Estado normal','2024-06-18 08:24:39','2024-06-19 08:34:40'),(44,2,9,39,'2024-06-18',55,36,119.72,68,NULL,NULL,'2024-06-18 10:15:03','2024-06-18 10:15:03'),(45,2,12,39,'2024-06-18',55,36,119.72,68,NULL,'QUEIXA PRINCIPAL:\nDOR DE CABEÇA, DOR NO ESTOMAGO MAL  ESTAR\n\n\nHDA: \nTRATA-SE DE 